import React from "react";
import styled, { css } from "styled-components";

import colors, { ColorOptions } from "../utils/colors";

interface IconContainerProps {
  size?: number | string;
  fill?: ColorOptions;
  disabled?: boolean;
  hover?: boolean;
  hoverFill?: ColorOptions;
  clickable?: boolean;
  viewBox?: string;
  currentColor?: boolean;
  margin?: string;
  style?: React.CSSProperties;
}

const IconContainer = styled.svg<IconContainerProps>`
  flex: none;
  /* transition: fill 0.25s; */
  width: ${(props) =>
    props.size ? props.size : props.width ? props.width : "20px"};
  height: ${(props) =>
    props.size ? props.size : props.height ? props.height : "20px"};
  fill: ${(props) =>
    props.currentColor
      ? "currentColor"
      : props.fill
      ? colors[props.fill]
      : props.disabled
      ? colors.black10
      : colors.black40};
  ${(props) =>
    props.hover &&
    css`
      &:hover {
        fill: ${props.hoverFill ? colors[props.hoverFill] : colors.black100};
      }
    `}
  ${({ clickable }) => (clickable ? "cursor: pointer;" : "")}
  ${({ margin }) => (margin ? `margin: ${margin};` : "")}
`;

